import Link from 'next/link';

const Test = () => {
    const pids = ['id1','id2','id3']
    return (
        pids.map(pid =>
            <Link href="/post[pid]" as={`/post/${pid}`}>
            <a>Testing link</a>
        </Link>
        )
    );
}

export default Test;
